function generateFloat(seed) {

    // If the index doesn't exist, randomly generate an index.
    // Math.floor() should be just fine for this one time.
    if (!generateFloat.index)
        index = Math.floor(Math.random() * tableCryptoFloats.length);

    // If we are passed a seed
    if (seed !== undefined) {
        // Take the seed and make it an positive integer into the table
        index = Math.abs(Math.floor(Number(seed) % tableCryptoFloats.length));
    }

    // Make sure we are within bounds of the table
    if (index >= tableCryptoFloats.length)
        index = 0;

    // Return a number from the table
    return (tableCryptoFloats[index]);
}

